import { useParams } from "react-router";

function AnnonceDetail(props) {

    let { annonceId } = useParams();
    var annonces = props.annonces;

    <li>{annonces.filter(annonce => 
        annonce.title === "used car"
    )[0].annonceId}</li>


    return(
        <div>

            {annonces.map(annonce => (
                <li>
                    <li>{annonce.annonceId}</li>
                    <li>{annonce.title}</li>
                </li>
            ))}
        </div>
    )
}

export default AnnonceDetail;
